import './App.css';
import Sidebar from './defultComponent/sidebar';

function App() {
  return (
    <Router>
      <Routes>
        < Sidebar />
        <Route path='/' />
        <Route path='/menu' />
      </Routes>
    </Router>
  );
}

export default App;

